import React from 'react';
import StepComponent from './StepComponent';
import { Button, Col,Row } from 'antd'
const ContentComponent = () => {
    return (
        <div className="container">
            <StepComponent/>
            <Row style={{ textAlign: 'center' }}>
                <Col className="gutter-row" className="btn-click" span={6}>
                    <Button type="primary"  shape="round" >Nhà phân phối</Button>
                </Col>
                <Col className="gutter-row" className="btn-click" span={6}>
                    <Button type="primary"  shape="round" >Nhà sản xuất QT</Button>
                </Col>
                <Col className="gutter-row" className="btn-click" span={6}>
                    <Button type="primary"  shape="round" >Nhà sản xuất VN</Button>
                </Col>
                <Col className="gutter-row" className="btn-click" span={6}>
                    <Button type="primary"  shape="round" >Nhà nhập khẩu/ Đại lý</Button>
                </Col>
            </Row>
        </div>
    );
}

export default ContentComponent;
